css:
.atom-trello {
  overflow: hidden;
}
.atom-trello #back_btn {
  margin-top: 10px;
  float: left;
}
.atom-trello li .primary-line,
.atom-trello li .secondary-line,
.atom-trello li .atom-trello-card-description li {
  white-space: normal !important;
  text-overflow: clip !important;
  overflow: visible !important;
  word-wrap: break-word !important;
  clear: both;
}
.atom-trello .atom-trello-card-description li {
  border: none !important;
  padding: 0 !important;
  margin: 0 0 5px !important;
}
.atom-trello .atom-trello-card-description ol li:before,
.atom-trello .atom-trello-card-description ul li:before {
  position: absolute;
  margin-left: -1.8em;
}
.atom-trello .atom-trello-card-description ol {
  counter-reset: cardList;
}
.atom-trello .atom-trello-card-description ol li:before {
  counter-increment: cardList;
  content: counter(cardList) ". ";
}
.atom-trello .atom-trello-card-description ul li:before {
  content: '- ';
}
.atom-trello .at-title {
  float: left;
}
.atom-trello pre {
  font-size: 1em !important;
}
.atom-trello .at-avatars {
  float: right;
  margin-bottom: 5px;
  margin-top: -2px;
}
.atom-trello .at-avatars .at-avatar {
  overflow: hidden;
  float: left;
  border-radius: 50%;
  display: block;
  text-align: center;
  margin-left: 5px;
  width: 25px;
  height: 25px;
  line-height: 25px;
}
.atom-trello .at-avatars .at-avatar.no-img {
  border: 1px solid rgba(30, 30, 31, 0.85);
}
.atom-trello .at-filter {
  display: block;
  float: right;
  margin-top: 5px;
}
.atom-trello .at-filter .checkbox {
  cursor: pointer;
  font-size: 9px;
  display: inline-block;
  margin-left: 20px;
}
.theme-atom-material-ui .atom-trello .at-filter {
  margin-right: 10px;
}
.theme-atom-material-ui .atom-trello #back_btn {
  margin-left: 10px;
}
